import React, { useState, useEffect } from 'react';
import {Line} from 'react-chartjs-2';

const LineGraph = () =>{
    const [chartData, setChartData] = useState({});

    const chart = () =>{
        setChartData({
            labels: ['Hola', 'adios', 'adiosssos'],
            dataset: [
                {
                    label: 'level jaja',
                    data: [1,2,3,4,5],
                    backgrounfColor: ['rgba(75,192,192, 0.6'],
                    borderWidth: 4
                }
            ]
        })
    }

    useEffect(()=> {
        chart()
    }, [])


    return(
        <div className="App">
        <h1> Hola </h1>
        <div>
            <Line data={chartData} options={{
               responsive: true 
            }}/>
        </div>
        </div>
    )
}

export default LineGraph;
